import React from "react";
import "./ResultsList.css";

const getCoverArtUrl = (releaseId) =>
  `https://coverartarchive.org/release/${releaseId}/front-250`;

export const ResultsList = ({ results }) => {
  return (
    <ul>
      {results.map((result) => (
        <li key={result.id}>
          <img
            src={getCoverArtUrl(result.id)}
            alt={`Cover art for ${result.title}`}
            style={{ width: 64, height: 64, objectFit: "cover", marginRight: 8 }}
            onError={(e) => {
              e.target.onerror = null;
              e.target.src =
                "https://via.placeholder.com/64?text=No+Art";
            }}
          />
          {result.title} by {result.artist} ({result.firstReleaseDate}, id: {result.id})
        </li>
      ))}
    </ul>
  );
};
